// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

import "./Storage.sol";

interface IStorage {
    function store(uint256 num) external;
    function getCreator() external view returns (string memory);
    function getUser(string memory _name) external view returns (string memory, uint256);
    function addUser (string memory _name, uint256 _number) external;
}

/**
 * @title Owner
 * @dev Set & change owner
 */
contract Owner {

    address private owner;

    // event for EVM logging
    event OwnerSet(address indexed oldOwner, address indexed newOwner);
    event StoreCreated(address indexed storeAddress);

    // modifier to check if caller is owner
    modifier isOwner() {
        // If the first argument of 'require' evaluates to 'false', execution terminates and all
        // changes to the state and to Ether balances are reverted.
        // This used to consume all gas in old EVM versions, but not anymore.
        // It is often a good idea to use 'require' to check if functions are called correctly.
        // As a second argument, you can also provide an explanation about what went wrong.
        require(msg.sender == owner, "Caller is not owner");
        _;
    }

    /**
     * @dev Set contract deployer as owner
     */
    constructor() {
        owner = msg.sender; // 'msg.sender' is sender of current call, contract deployer for a constructor
        emit OwnerSet(address(0), owner);
    }

    function createStore(uint256 value) external returns (address storeAddress) {
        bytes memory bytecode = type(Storage).creationCode;
        uint256 salt = 1234567;
        assembly {
            storeAddress := create2(0, add(bytecode, 32), mload(bytecode), salt)
        }
        IStorage(storeAddress).store(value);
        emit StoreCreated(storeAddress);
    }

    /**
     * @dev Change owner
     * @param newOwner address of new owner
     */
    function changeOwner(address newOwner) public isOwner {
        emit OwnerSet(owner, newOwner);
        owner = newOwner;
    }

    /**
     * @dev Return owner address 
     * @return address of owner
     */
    function getOwner() external view returns (address) {
        return owner;
    }
}

contracts/Storage.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

/**
 * @title Storage
 * @dev Store & retrieve value in a variable
 */
contract Storage {

    uint256 number;

    struct Person {
        string name;
        uint256 number;
    }

    Person public creator = Person("thantsintoe", 100);

    Person[] public users;

    mapping(string => Person) public userMap;

    /**
     * @dev Store value in variable
     * @param num value to store
     */
    function store(uint256 num) public {
        number = num;
    }

    function getCreator() public view returns (string memory) {
        return creator.name;
    }

    function getUser(string memory _name) public view returns (string memory, uint256) {
        Person memory user = userMap[_name];
        return (user.name, user.number);
    }

    function addUser (string memory _name, uint256 _number) public {
        Person memory newUser = Person(_name, _number);
        users.push(newUser);
        userMap[_name] = newUser;
    }

    /**
     * @dev Return value 
     * @return value of 'number'
     */
    function retrieve() public view returns (uint256){
        return number;
    }
}

contracts/Token.sol.content:
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract Token is ERC20 {
    mapping(address => bool) private claimed;
    constructor(string memory name, string memory symbol, uint256 supply) ERC20(name, symbol) {
        _mint(msg.sender, supply);
    }
    function claim() public {
        assert(claimed[msg.sender] != true);
        if (claimed[msg.sender] != true) {
            _mint(msg.sender, 10000000000000000000000);
            claimed[msg.sender] = true;
        }
    }
}

